import React from "react";
import "./Style.css";

export class OptionPage extends React.Component {
  componentDidMount() {
    if (!localStorage.getItem("LEADERBOARDDATA")) {
      localStorage.setItem("LEADERBOARDDATA", [
        { name: "zahid@gmail.com", score: "39" },
        { name: "za@gmail.com", score: "89" },
      ]);
    }
  }
  render() {
    return (
      <div>
        <h1 style={{ color: "white", textAlign: "center", padding: "20px" }}>
          WELCOME
        </h1>
        <div>
          <h2
            style={{
              color: "white",
              textAlign: "center",
              paddingBottom: "70px",
              paddingTop: "30px",
            }}
          >
            Choose One Option
          </h2>
        </div>
        <div>
          <button className="optionButton">
            <a href="/playexisting">Security Analysis</a>
          </button>
          <button className="Disabled">Work In Progress</button>
        </div>
      </div>
    );
  }
}
export default OptionPage;
